import AppLayout from "../components/AppLayout";

const Home = () => {
    const { isLoggedIn } = useSelector((state) => state.user);
    const { mainPosts } = useSelectpr((state) => state.post);
    return (
        <AppLayout>
            {isLoggedIn && <PostForm />}
            {mainPosts.map((post) => <PostCard post={post}/>)}
            <PostCard />
        </AppLayout>
    );
}

export default Home;
